import React, { useState, useEffect } from "react";
import { APIProvider, Map } from '@vis.gl/react-google-maps';
import { Link } from "react-router-dom";
import logo from './logo.png'; 

const position = { lat: 6.8214925581511565, lng: 80.04122509763354 };

const Dashboard = () => {
    const [height, setHeight] = useState(0); // Height state

    useEffect(() => {
        const column2 = document.getElementById('column_two');
        if (column2) {
            setHeight(column2.offsetHeight);
        }
    }, []);

    return (
        <APIProvider apiKey={"YOUR_API_KEY"}>
            <>
                <nav className="navbar">
                    <div className="logo">
                        <img src={logo} alt="Logo" width="100" height="100" />
                    </div>
                    <Link to="/Home" title="Home"><b>Home</b></Link>
                    <Link to="/Dashboard" title="Dashboard"><b>Dashboard</b></Link>
                    <Link to="/Profile" title="Profile"><b>Profile</b></Link>
                    <Link to="/Reservations" title="Reservations"><b>Reservations</b></Link>
                </nav>

                <div className="container">
                    <div className="content">
                        <article className="section">
                            <div className="tc">
                                <img src="https://students.nsbm.ac.lk/img/1nsbm.png" className="h3 w7 dib ba b--black-05 pa2" alt="kitty staring at you" />
                                <h3 className="ma0">Welcome Student</h3>
                                <h2 className="f5 fw4 gray mt0">To NSBM Accommodation Rental Service</h2>
                            </div>
                        </article>

                        <article className="section">
                            <div className="tc">
                                <h1 className="mt0">Accommodations</h1>
                                <div className="map-container">
                                    <Map defaultCenter={position} defaultZoom={12}></Map>
                                </div>
                            </div>
                        </article>
                    </div>
                </div>

                <footer className="footer">
                    <small className="copyright">Â© Created by Group CC, All Rights Reserved.</small>
                </footer>
            </>
        </APIProvider>
    );
}

export default Dashboard;
